import React from "react";
import "./MangasList.css";

const MangasList = ({ m }) => {
  return (
    <div>
      <div className="one">
        <div className="manga_cover">
          <img src={m.img} alt="manga" />{" "}
        </div>
        <div className="disc">
          <h4>{m.name}</h4>
          <p>
            {m.disc} <a href="#">read more</a>
          </p>
          <button className="yelow ish">
            <i className="fas fa-eye" />
            watch now
          </button>
        </div>
      </div>
    </div>
  );
};

export default MangasList;
